import React, { useState } from 'react';

const TABS = ['Trending', 'Rising Creators', 'By Meta', 'For You'];

// Mock strategy data - in a real app, this would come from an API
const strategyData = {
  1: {
    name: "Quick Pump",
    creator: "@AlphaWizard",
    winRate: 72,
    liveTokens: 5,
    description: "2+ Smart Wallet Buys, Volume Spike > 200%",
    parameters: [
      { name: "Minimum Volume", value: "$100k" },
      { name: "Wallet Threshold", value: "2+ Smart Wallets" },
      { name: "Volume Spike", value: ">200%" },
      { name: "Time Window", value: "1 hour" }
    ],
    performance: {
      totalTrades: 156,
      successRate: "72%",
      avgReturn: "+15.2%",
      bestTrade: "+42.3%"
    }
  },
  2: {
    name: "Diamond Hands",
    creator: "@CryptoPro",
    winRate: 85,
    liveTokens: 3,
    description: "Long-term hold with smart money accumulation",
    parameters: [
      { name: "Hold Time", value: "30+ days" },
      { name: "Smart Money", value: "3+ Wallets" },
      { name: "Volume Trend", value: "Increasing" },
      { name: "Market Cap", value: "<$10M" }
    ],
    performance: {
      totalTrades: 89,
      successRate: "85%",
      avgReturn: "+28.5%",
      bestTrade: "+156.7%"
    }
  },
  3: {
    name: "Flash Trade",
    creator: "@QuickTrader",
    winRate: 65,
    liveTokens: 7,
    description: "Quick in and out based on volume spikes",
    parameters: [
      { name: "Entry Time", value: "5 minutes" },
      { name: "Exit Time", value: "15 minutes" },
      { name: "Volume Spike", value: ">300%" },
      { name: "Price Action", value: "Breakout" }
    ],
    performance: {
      totalTrades: 234,
      successRate: "65%",
      avgReturn: "+8.3%",
      bestTrade: "+32.1%"
    }
  }
};

export default function DiscoverTab({ goBack }) {
  const [active, setActive] = useState(0);
  const [selectedStrategy, setSelectedStrategy] = useState(null);

  const handleStrategyClick = (id) => {
    setSelectedStrategy(strategyData[id]);
  };

  const closeStrategyDetails = () => {
    setSelectedStrategy(null);
  };

  return (
    <div className="w-full max-w-6xl mx-auto py-12">
      {goBack && (
        <button onClick={goBack} className="mb-6 flex items-center text-sm text-blue-400 hover:underline focus:outline-none">
          <span className="mr-2">←</span> Back to Home
        </button>
      )}
      <h2 className="text-3xl font-bold text-gray-100 mb-8 text-center">Discover</h2>
      <div className="flex gap-4 justify-center mb-8">
        {TABS.map((tab, idx) => (
          <button
            key={tab}
            className={`px-4 py-1 rounded-full font-semibold text-base transition-all duration-200 ${active === idx ? 'bg-gradient-to-r from-zinc-800 to-zinc-700 text-white shadow' : 'bg-zinc-900/40 text-gray-400 hover:text-white hover:bg-zinc-800/60'}`}
            onClick={() => setActive(idx)}
          >
            {tab}
          </button>
        ))}
      </div>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
        {[1,2,3].map((i) => (
          <div
            key={i}
            className="bg-black/30 backdrop-blur-lg rounded-2xl border border-zinc-500/40 shadow-xl p-8 flex flex-col gap-2 cursor-pointer hover:border-blue-500 transition-all"
            onClick={() => handleStrategyClick(i)}
          >
            <div className="flex items-center gap-2 mb-2">
              <span className="text-sm text-blue-400 font-bold">@AlphaWizard</span>
              <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5 text-xs">Trending</span>
            </div>
            <h3 className="text-xl font-bold text-white">Quick Pump</h3>
            <p className="text-gray-300 text-sm mb-2">2+ Smart Wallet Buys, Volume Spike &gt; 200%</p>
            <div className="flex items-center gap-2 text-xs text-green-400 mb-2">Win Rate: 72% <span className="text-gray-400">•</span> Live: 5 tokens</div>
            <button className="mt-auto px-4 py-2 rounded bg-zinc-800 border border-gray-600 text-sm text-white hover:bg-zinc-700 transition">View Flow</button>
          </div>
        ))}
      </div>

      {/* Strategy Details Modal */}
      {selectedStrategy && (
        <div className="fixed inset-0 bg-black/80 backdrop-blur-sm flex items-center justify-center p-4 z-50">
          <div className="bg-zinc-900 rounded-xl max-w-4xl w-full max-h-[90vh] overflow-y-auto">
            <div className="p-6">
              <div className="flex justify-between items-start mb-6">
                <div>
                  <h2 className="text-2xl font-bold text-white mb-2">{selectedStrategy.name}</h2>
                  <div className="flex items-center gap-2">
                    <span className="text-sm text-blue-400">{selectedStrategy.creator}</span>
                    <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5 text-xs">Live: {selectedStrategy.liveTokens} tokens</span>
                  </div>
                </div>
                <button
                  onClick={closeStrategyDetails}
                  className="text-gray-400 hover:text-white"
                >
                  ✕
                </button>
              </div>

              <div className="grid grid-cols-1 md:grid-cols-2 gap-6 mb-6">
                <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                  <h3 className="text-xl font-bold text-white mb-4">Strategy Parameters</h3>
                  <div className="space-y-3">
                    {selectedStrategy.parameters.map((param, index) => (
                      <div key={index} className="flex justify-between items-center">
                        <span className="text-gray-400">{param.name}</span>
                        <span className="text-white font-medium">{param.value}</span>
                      </div>
                    ))}
                  </div>
                </div>

                <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                  <h3 className="text-xl font-bold text-white mb-4">Performance Metrics</h3>
                  <div className="space-y-3">
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Total Trades</span>
                      <span className="text-white font-medium">{selectedStrategy.performance.totalTrades}</span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Success Rate</span>
                      <span className="text-green-400 font-medium">{selectedStrategy.performance.successRate}</span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Average Return</span>
                      <span className="text-green-400 font-medium">{selectedStrategy.performance.avgReturn}</span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-gray-400">Best Trade</span>
                      <span className="text-green-400 font-medium">{selectedStrategy.performance.bestTrade}</span>
                    </div>
                  </div>
                </div>
              </div>

              <div className="bg-black/40 rounded-xl p-6 border border-zinc-800">
                <h3 className="text-xl font-bold text-white mb-4">Strategy Flow</h3>
                <div className="bg-zinc-900/50 rounded-lg p-4 border border-zinc-800">
                  <div className="text-gray-400 text-center">
                    Strategy flow visualization will be implemented here
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
